import React from 'react'
import './styles.css';
import Content from './Content'
import Header from './Header'
import Nav from './Nav';
import Footer from './Footer';


const App = () => {
  return (
    <div className = 'app-wrapper'>
      <header className ='header'>
        <img src="https://logos-world.net/wp-content/uploads/2020/10/Free-Emblem.png" alt="" />

      </header> 
      <nav className ='nav'>
        <div>
            <a>Profile</a>
        </div>
        <div>
            <a>Messages</a>
        </div>    
      </nav> 
      <div className ='content'>

      </div> 

      <Footer />
    </div>
  );
}


export default App;
